(178, 'Cream Cheese (1 kg)', '990', '0', 'https://theeliteenterprise.in/_API/Products_images/1740743269_Cream Cheese (1 kg) - Elite.webp', 'https://theeliteenterprise.in/_API/Products_images/1740743269_Elite Enterprise Fssai Number.webp', 'https://theeliteenterprise.in/_API/Products_images/1740743269_All Products are Veg _ Elite Enterprise.webp', '', '1', 0, 1, '62', '0', 'Made in France with French milk, it is the result of Norman dairy know-how and the expertise of Elle & Vire Professionel® chefs.', '<span style=\"color: rgb(10, 10, 10); font-family: &quot;PT Sans&quot;, sans-serif; font-size: 16px;\">Made in France with French milk, it is the result of Norman dairy know-how and the expertise of Elle &amp; Vire Professionel® chefs.</span><br style=\"color: rgb(10, 10, 10); font-family: &quot;PT Sans&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(10, 10, 10); font-family: &quot;PT Sans&quot;, sans-serif; font-size: 16px;\">Characterized by creamy notes and a good cheese taste, the French Cream Cheese enhances both sweet and savory preparations.</span><br style=\"color: rgb(10, 10, 10); font-family: &quot;PT Sans&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(10, 10, 10); font-family: &quot;PT Sans&quot;, sans-serif; font-size: 16px;\">Its soft and easy-to-work texture is easily incorporated with the other ingredients, giving a creamy and smooth texture to your recipes.</span><br style=\"color: rgb(10, 10, 10); font-family: &quot;PT Sans&quot;, sans-serif; font-size: 16px;\"><br style=\"color: rgb(10, 10, 10); font-family: &quot;PT Sans&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(10, 10, 10); font-family: &quot;PT Sans&quot;, sans-serif; font-size: 16px;\">According to Nicolas Boussin expertise, Best Pastry Craftsman of France 2000 – Executive Pastry Chef of La Maison de l’Excellence Savencia®: “This cheese, with an intensely creamy and very fresh taste, is characteristic of the Norman know-how. It brings a unique smoothness and reveals other ingredients”.</span>', '100', '10'),
(182, 'Elle & Vire Excellence Whipping Cream 1Kg ', '880', '0', 'https://theeliteenterprise.in/_API/Products_images/1740743956_Elle-Vire-Excellence-Whipping-Cream - Elite.jpg', 'https://theeliteenterprise.in/_API/Products_images/1740743956_Elite Enterprise Fssai Number.webp', 'https://theeliteenterprise.in/_API/Products_images/1740743956_All Products are Veg _ Elite Enterprise.webp', '', '1', 0, 1, '62', '0', 'An Unrivalled Natural Dairy Fresh Taste  Ideal to use plain or flavoured with vanilla and whipped, Elle & Vire Excellence 35% whipping cream is specially designed for chefs who value the taste.', '<p style=\"margin-bottom: 1.25rem; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.1428em; line-height: 1.6875; letter-spacing: -0.015em; color: rgb(119, 119, 119);\"><span style=\"font-weight: 700;\">An Unrivalled Natural Dairy Fresh Taste</span></p><p style=\"margin-bottom: 0px; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.1428em; line-height: 1.6875; letter-spacing: -0.015em; color: rgb(119, 119, 119);\">Ideal to use plain or flavoured with vanilla and whipped, Elle &amp; Vire Excellence 35% whipping cream is specially designed for chefs who value the taste.</p>', '100', '10'),
(183, 'Elle & Vire Mascarpone 1L', '1338', '0', 'https://theeliteenterprise.in/_API/Products_images/1740744045_Elle & Vire Mascarpone - Elite.jpg', 'https://theeliteenterprise.in/_API/Products_images/1740744045_Elite Enterprise Fssai Number.webp', 'https://theeliteenterprise.in/_API/Products_images/1740744045_All Products are Veg _ Elite Enterprise.webp', '', '1', 0, 1, '62', '0', 'Elle & Vire Professionnel Mascarpone : an outstanding innovation for chefs. ', '<p style=\"margin-bottom: 1.25rem; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.1428em; line-height: 1.6875; letter-spacing: -0.015em; color: rgb(119, 119, 119);\"><span style=\"font-weight: 700;\">Ideal For Both Sweet &amp; Svaoury Creations.</span></p><p style=\"margin-bottom: 1.25rem; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.1428em; line-height: 1.6875; letter-spacing: -0.015em; color: rgb(119, 119, 119);\">Elle &amp; Vire&nbsp;Professionnel&nbsp;Mascarpone&nbsp;: an outstanding innovation for chefs. Based on its French dairy expertise and proximity with chefs,&nbsp;Elle &amp; Vire&nbsp;Professionnel has developped a new UHT&nbsp;Mascarpone&nbsp;with all the qualities of a fresh one.</p><p style=\"margin-bottom: 1.25rem; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.1428em; line-height: 1.6875; letter-spacing: -0.015em; color: rgb(119, 119, 119);\">Easy to work – Semi -thick texture.</p><p style=\"margin-bottom: 0px; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.1428em; line-height: 1.6875; letter-spacing: -0.015em; color: rgb(119, 119, 119);\">Easy to store – 1L format.</p>', '100', '10'),
(184, 'Elle & Vire Professionnel Extra Dry Butter - 1Kg', '1850', '0', 'https://theeliteenterprise.in/_API/Products_images/1740744247_Elle & Vire Professionnel Extra Dry Butter - Elite.png', 'https://theeliteenterprise.in/_API/Products_images/1740744247_Elite Enterprise Fssai Number.webp', 'https://theeliteenterprise.in/_API/Products_images/1740744247_All Products are Veg _ Elite Enterprise.webp', '', '1', 0, 1, '62', '0', 'Authentic taste and excellent dough plasticity … Made using traditional methods, the Extra Dry Butter (84% fat) is ideal for making Viennese pastries and puff pastry.', '<font color=\"#444444\"><span style=\"font-size: 14px; letter-spacing: -0.5px;\">Authentic taste and excellent dough plasticity … Made using traditional methods, the Extra Dry Butter (84% fat) is ideal for making Viennese pastries and puff pastry.</span><font face=\"Gotham SSm A, Gotham SSm B\"><span style=\"font-size: 14px; letter-spacing: -0.5px;\">Made from carefully selected creams, Elle &amp; Vire Professionnel Extra Dry Butter (84% fat) lends a delicious, creamy taste to your puff pastry. Its high fat content adds a melt-in-the-mouth quality to your puff pastry. Offering high performance, the Extra Dry Butter (84% fat) is particularly easy to work. Its high melting point makes it is extremely heat resistant</span></font></font><div><font color=\"#444444\"><font face=\"Gotham SSm A, Gotham SSm B\"><span style=\"font-size: 14px; letter-spacing: -0.5px;\"><br></span></font></font></div>', '100', '10'),
